INSERT INTO `question` VALUES ('043a48ae09bb4e67af65e28e621956e6','以下那些不是Go語言的優點',5,'4910b3c8749d4c74aa3c27e36f7fc374',1,2,3,'<h3 style=\"font-family: Lato, &quot;PingFang TC&quot;, &quot;Helvetica Neue&quot;, Helvetica, 微軟正黑體, 新細明體, Arial, sans-serif; font-weight: bold; line-height: 1.5; color: rgb(48, 50, 51); margin-top: 30px; margin-bottom: 14px; font-size: 22px;\"><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">﻿</span><span style=\"font-size: 14px;\">1. 效能極高：效能跟java和C++相近 比python快30倍。</span></h3><h3 style=\"font-family: Lato, &quot;PingFang TC&quot;, &quot;Helvetica Neue&quot;, Helvetica, 微軟正黑體, 新細明體, Arial, sans-serif; font-weight: bold; line-height: 1.5; color: rgb(48, 50, 51); margin-top: 30px; margin-bottom: 14px; font-size: 22px;\"><span style=\"font-size: 14px;\">2. 快速編譯 部署：跟其他靜態語言相比，編譯速度極快，通常可以在30秒內編譯完，編譯完之後的binary也可以直接部署上機器。</span></h3><h3 style=\"font-family: Lato, &quot;PingFang TC&quot;, &quot;Helvetica Neue&quot;, Helvetica, 微軟正黑體, 新細明體, Arial, sans-serif; font-weight: bold; line-height: 1.5; color: rgb(48, 50, 51); margin-top: 30px; margin-bottom: 14px; font-size: 22px;\"><span style=\"font-size: 14px;\">3. 程式碼保密性高：由於編譯完的binary可以直接執行，給予其他公司執行時可以防止程式碼外洩，而編譯完成後的binary也無法反編譯。</span></h3><h3 style=\"font-family: Lato, &quot;PingFang TC&quot;, &quot;Helvetica Neue&quot;, Helvetica, 微軟正黑體, 新細明體, Arial, sans-serif; font-weight: bold; line-height: 1.5; color: rgb(48, 50, 51); margin-top: 30px; margin-bottom: 14px; font-size: 22px;\"><span style=\"font-size: 14px;\">4. 多平台編譯：go可以直接指定編譯成各種平台版本，像是window或debian，不用煩惱平台問題。</span></h3>','ffc3a536b7c84277a58eb291ff1f5f6f-7fc0c96caee44d9d9dd6327855523369-b1b4d687974f487eac0d985c68142c51-99938cc925294954a6b189077b9622d3-191d74a830214d369677ef7ccd43014a','7fc0c96caee44d9d9dd6327855523369-191d74a830214d369677ef7ccd43014a','2022-05-24 03:01:41','2022-05-24 03:01:41'),('20bbe07646ac4917b4123f752396e6b3','<p>pyhon是非題222?</p>',5,'275b47a776524b8f9357fdc2e83cde06',2,3,2,'<p>pyhon是非題222?<br></p>',