,'2022-05-24 03:09:29'),('bf80a9057101471cb7ae9d7e34c3bf2d','<p>pyhon多選題111</p>',5,'275b47a776524b8f9357fdc2e83cde06',1,2,2,'<p>pyhon多選題111<br></p>','67aba4c85d324b188bd3fb994e2487c6-68d20f2f90174334a8fc486a4bcd0b0a-536de341f62c4ffc94c919ccccdfa057-1524eab3fb914c1498926bb49e1d8978','67aba4c85d324b188bd3fb994e2487c6-536de341f62c4ffc94c919ccccdfa057','2022-05-23 14:49:36','2022-05-23 14:49:36'),('c141fb98a1df4b33a1e4f7484c2d3dda','Go語言的吉祥物是什麼動物?',5,'4910b3c8749d4c74aa3c27e36f7fc374',3,1,3,'<font color=\"#202122\" face=\"-apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Lato, Helvetica, Arial, sans-serif\"><span style=\"font-size: 16px;\">可愛的地鼠~~</span></font>','6624b142676d472b8a16a0219f1a2a82-3f77c684275649dfa345bef58d8071be-db5755515b61490bba992dc65a54e519-1330a4f992d548f8894aad0029c595b4','3f77c684275649dfa345bef58d8071be','2022-05-24 02:54:50','2022-05-24 02:54:50'),('cd3cb8ef4baf4f66bf1b4964507cd24a','<p>pyhon單選題</p>',5,'275b47a776524b8f9357fdc2e83cde06',1,1,2,'<p>pyhon單選題<br></p>','de937cda0f2a4c8e9a9f5084949f2ea7','de937cda0f2a4c8e9a9f5084949f2ea7','2022-05-23 14:50:28','2022-05-23 14:50:28'),('d35af1fcbb7a45ff952c6d1bcc0ecb9b','Go語言之父是誰?',5,'4910b3c8749d4c74aa3c27e36f7fc374',2,1,3,'<p><b style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: bold; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(32, 33, 34);\">羅勃特·派克</b><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">（</span><span lang=\"en\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(32, 33, 34);\">Robert C. Pike</span><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">，1956年</span><span class=\"useeditintro\" title=\"Template:BLP editintro\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(32, 33, 34);\">－</span><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">），暱稱為</span><b style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: bold; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(32, 33, 34);\">羅勃·派克</b><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">（</span><span lang=\"en\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(32, 33, 34);\">Rob Pike</span><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">），來自加拿大的程式設計師，曾經加入</span><a href=\"https://zh.m.wikipedia.org/wiki/%E8%B2%9D%E7%88%BE%E5%AF%A6%E9%A9%97%E5%AE%A4\" class=\"mw-redirect\" title=\"貝爾實驗室\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background: none rgb(255, 255, 255); color: rgb(51, 102, 204);\">貝爾實驗室</a><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">，為&nbsp;</span><a href=\"https://zh.m.wikipedia.org/wiki/UNIX\" title=\"UNIX\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background: none rgb(255, 255, 255); color: rgb(51, 102, 204);\">UNIX</a><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">小組的成員。曾經參與過</span><a href=\"https://zh.m.wikipedia.org/wiki/%E8%B2%9D%E7%88%BE%E5%AF%A6%E9%A9%97%E5%AE%A4%E4%B9%9D%E8%99%9F%E8%A8%88%E7%95%AB\" title=\"貝爾實驗室九號計畫\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background: none rgb(255, 255, 255); color: rgb(51, 102, 204);\">貝爾實驗室九號計畫</a><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">、</span><a href=\"https://zh.m.wikipedia.org/wiki/Inferno\" class=\"mw-disambig\" title=\"Inferno\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background: none rgb(255, 255, 255); color: rgb(51, 102, 204);\">Inferno</a><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">，與程式語言&nbsp;</span><a href=\"https://zh.m.wikipedia.org/wiki/Limbo\" class=\"mw-redirect\" title=\"Limbo\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px; vertical-align: baseline; background: none rgb(255, 255, 255); color: rgb(51, 102, 204);\">Limbo</a><span style=\"color: rgb(32, 33, 34); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Lato, Helvetica, Arial, sans-serif; font-size: 16px;\">的開發。</span><br></p>','470ef63fbe61408aac6839e4e8fa73ec-9c92b5ae08034ed6924108ada29c36b0-9085147e65b4424b97382fde42481473-52d7f60170da4ebbbab2a31d230f15b8','470ef63fbe61408aac6839e4e8fa73ec','2022-05-24 02:53:23','2022-05-24 02:53:23'),('e934c2b7a5c1486598957705fa4ae978','<p>JAVA是否能保證gc的執行?<br></p>',5,'275b47a776524b8f9357fdc2e83cde06',1,3,1,'<p>否，垃圾回收機制程式設計師無法保證，但可以透過System.gc()叫用。<br></p>','c40ae15d83214c5cb71672e013530cf8-b20b6378756946919dce4ac0ac302811','b20b6378756946919dce4ac0ac302811','2022-05-23 14:39:23','2022-05-23 14:39:23'),('f2345d067b6345bf8dc0f77cbeaab62e','ArrayList、int[]、Vector如何取得元素長度?',5,'275b47a776524b8f9357fdc2e83cde06',2,1,1,'<p>ArrayList：size()</p><p>陣列：length</p><p>Vector：length()<br></p>','33e0e87e115f447fa82e688807a86bfe-9906a5bf84ea452c81418afdc4c013ff-0d8658c963e0428d81fe874c2e1d3f92-fc4c4c28dce44911ad66afe944af8011','9906a5bf84ea452c81418afdc4c013ff','2022-05-23 14:37:46','2022-05-23 14:37:46'),('f9ae1870d7d94733aeb09d79dd922a53','<p>請問以下那些選項為基本型別?</p>',5,'275b47a776524b8f9357fdc2e83cde06',3,2,1,'byte short int long float double boolean char 共8個','7983a63e5e3948f2bedb0168cc649977-d9c80a0b0bc44af1958e16f46f6cfd50-fa081f05856f49e98169101e32bdde99-e7ca60a47e794bd5b82e284909943d7e-d6d23d190c0e4d60899b5ce5e268a689','7983a63e5e3948f2bedb0168cc649977-d9c80a0b0bc44af1958e16f46f6cfd50-e7ca60a47e794bd5b82e284909943d7e-d6d23d190c0e4d60899b5ce5e268a689','2022-05-23 14:30:56','2022-05-23 14:30:56');
